    const [role, setRole] = useState("");

    useEffect(() => {
        const fetchPrivateDate = async () => {
          const config = {
            headers: {
              "Content-Type": "application/json",
              token: localStorage.getItem("authToken"),
            },
          };

          try {
            const {data}  = await axios.get("/checkRole", config);
            setRole(data.data);
            console.log(data.data);
